import React, { useState } from "react";
import {
  Paper,
  TextField,
  Button,
  Avatar
} from "@material-ui/core";
import { useTheme } from "@material-ui/styles";

// styles
import useStyles from "./styles";

// components
import { Typography } from "../../components/Wrappers";
import { showIdentification, showName } from "../../context/UserContext";



export default function Dashboard(props) {
  var classes = useStyles();
  var theme = useTheme();


  return (
    <>
      <Paper
        variant="elevation"
        elevation={5}
        className={classes.principalContainer}
        square= {false}
      >
                <div className={classes.formContainer}>
                <div className={classes.form}>

            <Typography variant="h1" className={classes.title}>
              Nuevo inventario
            </Typography>
            <TextField
              id="dependece"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              disabled = "true"
              margin="normal"
              placeholder="Sistemas"
              label="Dependencia"
              variant="outlined"              
            />
            <TextField
              id="name"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              disabled = "true"
              margin="normal"
              placeholder={showName}
              label={showName}
              variant="outlined"              
            />
            <TextField
              id="identification"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              disabled = "true"
              margin="normal"
              placeholder="Número de identificación"
              label={showIdentification}
              variant="outlined"              
            />
            <Typography variant="h2" className={classes.title}>
              Bienes a registrar
            </Typography>
            <TextField
              id = "descripcion"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              label= "Descripción"
              placeholder = "Descripción"
              variant= "outlined"
            />
            <TextField
              id = "placa"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              label= "Placa"
              placeholder = "Placa"
              variant= "outlined"
            />
              <TextField
              id = "Sede"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              label= "Sede"
              placeholder = "Sede"
              variant= "outlined"
            />
            <TextField
              id = "Espacio"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              label= "Espacio Físico"
              placeholder = "Espacio Físico"
              variant= "outlined"
            />
                        <TextField
              id = "Marca"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              label= "Marca y Serie"
              placeholder = "Marca y Serie"
              variant= "outlined"
            />
                        <TextField
              id = "Estado"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              label= "Estado"
              placeholder = "Estado"
              variant= "outlined"
            /> 
            <TextField
            id = "Motivo"
            InputProps={{
              classes: {
                underline: classes.textFieldUnderline,
                input: classes.textField,
              },
            }}
            label= "Motivo Ingreso"
            placeholder = "Motivo Ingreso"
            variant= "outlined"
          />
          <Button
          variant = "contained"
          color = "secondary"
          className ={classes.addButton}  
          startIcon = {<Avatar src='https://www.freeiconspng.com/thumbs/check-tick-icon/tick-icon-30.png' className={classes.iconC}  />}>

          </Button>
                  </div>
                </div>
        </Paper>
    </>
  );
}
